//流程配置
import request from '@/utils/request';
export function getModelTree(category) {
  //获取树
  return request({
    url: "/workflow/actExtModel/tree/".concat(category),
    method: 'get'
  });
} //扩展流程定义查询

export function getRecords(query) {
  return request({
    url: "/workflow/actExtProcdef",
    method: 'get',
    params: query
  });
} //扩展流程活动查询

export function getActivity(query) {
  return request({
    url: "/workflow/actExtProcdef/".concat(query.prodefId, "/extActivity"),
    method: 'get',
    params: query
  });
} //扩展流程活动查询

export function getActivityConfig(query) {
  return request({
    url: "/workflow/actExtProcdef/".concat(query.prodefId, "/extActivity/").concat(query.activityid, "/config"),
    method: 'get'
  });
} //扩展流程定义更新 流程信息配置

export function infoConfig(id, data) {
  return request({
    url: "/workflow/actExtProcdef/".concat(id),
    method: 'patch',
    data: data
  });
} //扩展流程活动查询

export function updateConfig(query, data) {
  return request({
    url: "/workflow/actExtProcdef/".concat(query.prodefId, "/extActivity/").concat(query.activityid, "/config"),
    method: 'patch',
    data: data
  });
}
